//Propriedade: Informações que um componente PAI passa para o componente FILHO
//Estado: Estado: Informações mantidas pelo componente (Lembra de imutabilidade)
//<> tag fragment - pode ser usada no lugar da div pra não impactar os estilos

function App() {
  return(
    <div id="app">
      <aside></aside>
      <main></main>
    </div>
  );
}

export default App;
